import React from 'react';
import './App.css'
import NavigationBar from "./components/NavigationBar";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Welcome from "./components/Welcome";

function App() {

    const marginTop = {
        marginTop: "20px"
    }
    return (
        <div className="App">

            <NavigationBar/>
            <Container>
                <Row style={marginTop}>
                    <Welcome/>
                </Row>
            </Container>

        </div>
    );
}

export default App;
